import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import './TVShows.css';

function TVShows() {
  return (
    <div className="tv-shows">
      <Header />
      <h1>TV Shows</h1>
      <p>TV Shows are coming soon!</p>
      <Footer />
    </div>
  );
}

export default TVShows;
